import eventRepository from "@/_repositories/eventRepository";
import {UNIQUE_TOURNAMENT_IDS, UNIQUE_TOURNAMENT_LIST} from '../_constants'


const tournamentIDs=UNIQUE_TOURNAMENT_LIST.topUniqueTournamentIds;
const state={
    events:[],
    event_date: '',
    incidents:[],
    lineUp:{},
    selectedEvent:{}
}

const actions ={
    async getEvents({commit},stringDate){
        console.log("get event!!!")
        console.log(stringDate)
        commit('GET_EVENTS_RESULT', await eventRepository.getEvents(stringDate))
        // commit('GET_EVENTS_RESULT')
    },
    async getIncidents({commit},event_id){
        console.log("get incident!!!")
        console.log(event_id)
        commit('GET_INCIDENT_RESULT', await eventRepository.getIncidents(event_id))
        // commit('GET_INCIDENT_RESULT')
    },
    async getLineUp({commit},event_id){
        console.log("get LineUp!!!")
        console.log(event_id)
        commit('GET_LINEUP_RESULT', await eventRepository.getLineUp(event_id))
        // commit('GET_LINEUP_RESULT')
    },
}

const mutations = {
    setEventDate: (state, date)=>{
        state.event_date = date
    },
    setSelectedEvent: (state, event)=>{
        state.selectedEvent = event
    },
    GET_EVENTS_RESULT: (state, response) =>{
        if(response.status && response.status === 200){
            state.events = filterEventByTournament(response.data.data)
        }else{
            state.events = {}
        }
        // state.events = filterEventByTournament(fakeEvents.data)
    },
    GET_INCIDENT_RESULT: (state, response) =>{
        if(response.status && response.status === 200){
            state.incidents = response.data.data
        }else{
            state.incidents = {}
        }
        // state.incidents = fakeIncident3.data
    },
    GET_LINEUP_RESULT: (state, response) =>{
        if(response.status && response.status === 200){
            state.lineUp = response.data.data
        }else{
            state.lineUp = {}
        }
        // state.lineUp = fakeLineUp.data
    }
}

function filterEventByTournament(events){
    var filteredEvent = [];
    for(let e of events){
        if(e.tournament.uniqueTournament && tournamentIDs.includes(e.tournament.uniqueTournament.id)){
            if(!filteredEvent[`${e.tournament.uniqueTournament.id}`]){
                let array = [];
                array.push(e);
                filteredEvent[`${e.tournament.uniqueTournament.id}`] = array;
            }else{
                let array = filteredEvent[`${e.tournament.uniqueTournament.id}`];
                array.push(e);
                filteredEvent[`${e.tournament.uniqueTournament.id}`] = array;
            }
        }
    }
    return filteredEvent;
}

export const events = {
    namespaced: true,
    state,
    actions,
    mutations
}

